        polygon.points = [];
        polygon.lineStyle = {
            fillStyle: colorGenerator(null, true),
            strokeStyle: '',
            strokeWidth: '2'
        }
        polygon.contentStyle = { flex: 1, float: 'none', 'text-align': 'left', color: polygon.lineStyle.fillStyle.replace(/\d+\.?\d*\s*\)$/g, '1)') }
        Object.assign(self.currentPolygon, polygon);
